def Recommend_switch_cards_sichuanMJ_v2(input={}):
    user_cards = input.get('user_cards', {})
    hand_cards = user_cards.get('hand_cards', [])
    switch_n_cards = input.get('switch_n_cards', 3)
    start = time.time()
    recommend_switch_cards = sichuanMJ_v2.recommend_switch_cards(hand_cards=hand_cards, switch_n_cards=switch_n_cards)
    end = time.time()
    if end - start >= 2:
        logger.info("switch_cards_overtime:%s", input)
    return recommend_switch_cards

def Recommend_choose_color_sichuanMJ_v2(input={}):
    user_cards = input.get('user_cards', {})
    hand_cards = user_cards.get('hand_cards', [])
    switch_n_cards = input.get('switch_n_cards', 3)
    hand_cards.sort()
    start = time.time()
    recommend_choose_color = sichuanMJ_v2.recommend_choose_color(hand_cards=hand_cards, switch_n_cards=switch_n_cards)
    end = time.time()
    if end - start >= 2:
        logger.info("choose_color_overtime:%s", input)
    return recommend_choose_color

def RecommendCard_sichuanMJ_v2(input={}):
    user_cards = input.get('user_cards', {})
    seat_id = input.get('seat_id', 0)
    discards = input.get('discards', [])
    discards_op = input.get('discards_op', [])
    remain_num = input.get('remain_num', 136)
    round = input.get('round', [])
    colors_type_dict = {'0': 0x00, '1': 0x10, '2': 0x20}
    c_type = colors_type_dict[str(input.get('colors')[seat_id])]
    hand_cards = user_cards.get('hand_cards', [])           #手牌
    operate_cards = user_cards.get('operate_cards', [])     #副露
    hand_cards.sort()
    [e.sort() for e in operate_cards]
    hu_cards = input.get('hu_cards')
    start = time.time()
    recommendCard = sichuanMJ_v2.recommend_card(cards=hand_cards, suits=operate_cards, discards=discards,
                                                  discards_op=discards_op, remain_num=remain_num, round=round,
                                                  hu_cards=hu_cards, seat_id=seat_id, c_type=c_type)
    end = time.time()
    if end - start >= 2:
        logger.info("RecommendCard_overtime: %s", input)
    return recommendCard

def RecommendOperate_sichuanMJ_v2(input={}):
    out_card = input.get('out_card', 0)

    # 场面信息
    remain_num = input.get('remain_num', 0)
    isHu = input.get('isHu', False)
    discards_op = input.get('discards_op', [])
    discards = input.get('discards', [])
    hu_cards = input.get('hu_cards', [])

    # 玩家信息
    user_cards = input.get('user_cards', {})
    hand_cards = user_cards.get('hand_cards', [])
    operate_cards = user_cards.get('operate_cards', [])
    seat_id = input.get('seat_id', 0)
    colors_type_dict = {'0': 0x00, '1': 0x10, '2': 0x20}
    c_type = colors_type_dict[str(input.get('colors')[seat_id])]
    win_player_num = 0
    for index_p in range(len(hu_cards)):
        if index_p == seat_id:
            continue
        if hu_cards[index_p]:
            win_player_num += 1
    hand_cards.sort()
    [e.sort() for e in operate_cards]
    start = time.time()
    recommend_op, isHu = sichuanMJ_v2.recommend_op(op_card=out_card, cards=hand_cards, suits=operate_cards,
                                                   discards=discards, discards_op=discards_op, c_type=c_type,
                                                   win_player_num=win_player_num, self_turn=False, isHu=isHu,
                                                   remain_num=remain_num, hu_cards=hu_cards)
    end = time.time()
    if end - start >= 2:
        logger.info("RecommendOperate_overtime: %s", input)
    return recommend_op, isHu


